css:
/*
 * Yahoo search Dark grey
 *
 * Author      : Leeward
 * updated      : Sep 30 2009.
 */

@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document url-prefix("http://search.yahoo.com"), url-prefix(http://www.search.yahoo.com), url-prefix(http://video.search.yahoo.com/), url-prefix(http://images.search.yahoo.com) {
.app, a.h-button, #ysch .h-dialog button, a.ajax.active, #ygtb, .bdc {
	background: #505152 !important;
}
/* search bar */
#hd .bd {
margin-left:220px !important;
position:relative;
z-index:3 !important;
}
html {
	background: #505152 url("data:image/jpeg;base64,") top left repeat-x !important;
	color: #FFF !important;
	font-family: Tahoma, Arial, Helvetica, sans-serif !important;
}

#l, .logo, .logo-bot, #logo {
background-image: url(data:image/png;base64,) !important;
background-position: 0pt 0px !important;
height: 40px !important;
right: 0pt !important;
top: 10px !important;
width: 217px !important;
}

div [id="ygmalogo"] {
background-image: url(data:image/png;base64,) !important;
height: 40px !important;
right: 0pt !important;
left: 100pt !important;
top: 0px !important;
width: 217px !important;
}


/* hide */
div [class="ls"], [class="rs"], [class="l"], [class="r"], [id="r-e"] { display:none !important; }
img [id="ygmalogo"] [width="230"], [height="33"] { display:none !important; }
#main {
margin-right:1px !important; }


#sidebar, #bd  {
background:transparent url(data:image/png;base64,)!important;
}

/* defaults for all links */
a:link { color: #087905!important; }
a:visited { color: #087905!important; }
.sfc span, .sfc ul, .sfc ul li, .sfc ul li, .fm, a:active { color: #087905!important; }
#ft p.copyright{color:#6f9cb9;font-size:0%!important;margin:1em 0 0 27px;}


}
